import React from 'react';
import { css } from '@emotion/css'
const color = 'green'
function Header() {
    // Declare a new state variable, which we'll call "count"

    return (
        <div>
            <div className={css`
                width:100%;
                padding: 32px;
                font-size: 24px;
                padding:20px 30px;
                border-bottom: 1px solid #ccc;
                border-radius: 4px;
                &:hover {
                    color: ${color};
                }
            `}>
                <h3>Kanban Board</h3>
            </div>
        </div>
    );
}

export default Header;
